app.controller("profileEditController",["$scope","Upload","$timeout",(o,l,a)=>{o.openUploadProfilePictureModal=(()=>{$("#uploadProfilePictureModal").modal("show")}),o.onPhotoSelect=(()=>{o.openUploadProfilePictureModal()}),o.upload=function(t,e){l.upload({url:"https://angular-file-upload-cors-srv.appspot.com/upload",data:{file:l.dataUrltoBlob(t,e)}}).then(l=>{a(()=>{o.result=l.data})},l=>{l.status>0&&(o.errorMsg=l.status+": "+l.data)},l=>{o.progress=parseInt(100*l.loaded/l.total)})}}]);